==简介==
本模板应用于[[异常(游戏)]]中的代码展示，详见[[异常(游戏)/攻略]]。

该模板需要与 <nowiki>{{</nowiki>[[模板:异常 代码|异常 代码]]<nowiki>}}</nowiki> 配合使用。

==参数==
* 初始(可选)
* 条件(可选)
* 增量(可选)
* 缩进(可选) - 定义该模板内容的全局缩进
* 显示开始(可选) - 为强迫症患者准备，使用该参数时无需填写参数，不使用时应删除该参数。
* (其余所有参数) - 内容

